  return (
  <Router>
      <Switch>
        {/* Route for the BookingPage component */}
        <Route path="/booking-details" component={BookingPage} />

        {/* Route for the Login page */}
        <Route path="/login" component={LoginPage} />

        {/* Main route for Home, Navbar, Main, and Footer */}
        <Route path="/">
          <Navbar />
          <Home />
          <Main />
          <Footer />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
